const Graph = ({node}) => {

    if (node) {
        return (
            <Card sx={{ minWidth: 275 }} style={{backgroundColor: "#F2F1F1"}}>
                <CardContent>
                <div>
                    <p>{node.identity}</p>
                    <p>{node.labels}</p>
                    <p>{node.properties.name}</p>
                    <p>{node.properties.neo4jImportId}</p>
                </div>
                </CardContent>
            </Card>
        )

    } else {
        return (
        <Card><CardContent><div></div></CardContent></Card>)
    }



}

export default Graph
